import numpy as np


def createObjList(adrList, coords, types):
        t = len(coords)
        matrix = [[0 for x in range(4)] for y in range(t)]
        np.array(matrix)
        #fyller inn i matrisen
        for i in range (t):
            matrix[i][0] = i +1 #id
            matrix[i][1] = coords[i]
            matrix[i][2] = adrList[i]
            matrix[i][3] = types[i]

        #print(matrix)
        return matrix


def filterRecycle(matrix, type):
    t = len(matrix)
    filtered = []
    for i in range(t):
        if matrix[i][3] == type:
            filtered.append(matrix[i][1])# <-- koordinatene for riktig type
    print (filtered)
    return filtered

def findMarker(matrix, type):
    t = len(matrix)
    filteredAdr = []
    for i in range(t):
        if matrix[i][3] == type:
            filteredAdr.append(matrix[i][2])  # <-- koordinatene for riktig type
    print(filteredAdr)
    return filteredAdr


